informacaoComplementar:
A demanda decorre da necessidade institucional de obter suporte jurídico especializado em matérias trabalhistas e previdenciárias, dada a complexidade técnica, a constante atualização normativa e a relevância das decisões administrativas que impactam diretamente a gestão de pessoal e a conformidade legal da Autarquia.

A Diretoria e a Assessoria Jurídica frequentemente se deparam com situações que exigem análise aprofundada, pareceres complexos, interpretação de decisões recentes do STF, STJ, TST e TNU, bem como orientações sobre temas sensíveis como vínculos, enquadramentos, benefícios previdenciários, jornada, direitos laborais, políticas internas, licenças, penalidades e atendimento a órgãos fiscalizadores.

A contratação visa:
- dar suporte qualificado para tomada de decisões estratégicas, reduzindo riscos;
- apoiar a Assessoria Jurídica em análises altamente especializadas, de natureza predominantemente intelectual;
- assegurar segurança jurídica, padronização e conformidade com normas trabalhistas e previdenciárias;
- evitar passivos administrativos e judiciais decorrentes de decisões sem base técnica específica;
- garantir agilidade no atendimento das demandas da Diretoria.

Considerando a natureza técnica, específica e interpretativa das matérias envolvidas, é necessária a contratação de consultoria especializada com comprovada experiência nas áreas de Direito Trabalhista e Previdenciário.

objetoCompra:
Contratação de serviços de consultoria jurídica especializada em Direito Trabalhista e Previdenciário, sob demanda, visando ao fornecimento de análises jurídicas, pareceres, notas técnicas, orientações formais e suporte especializado às áreas envolvidas na gestão de pessoal, bem como apoio direto à Diretoria e à Assessoria Jurídica da Autarquia.]
Prestação de serviços de consultoria jurídica especializada, incluindo:
- emissão de pareceres jurídicos, notas técnicas, relatórios de análise e respostas formais;
- suporte técnico à Diretoria e à Assessoria Jurídica sobre temas trabalhistas e previdenciários;
- participação em reuniões técnicas quando convocado;
- análise de casos concretos, com respostas aos questionamentos iniciais e posteriores;
- orientações sobre conformidade e mitigação de riscos trabalhistas e previdenciários;
- apoio em processos administrativos internos relacionados à gestão de pessoal.
